package com.Practice_07_Methods;

public class _09_CelciusToFarenhite {
	public static double farenhite(double x)
	{
		return (x*9.0/5.0)+32.0;
		//double re patheibu mane samastanku double karide khela sesa
	}
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		System.out.println(farenhite(37));

	}

}
